StochasticPatchRunner <- function(T) {
  type <- c(T)
  valid <- list("StochasticPatchRunner<FF16>"="FF16")
  constructors <- list("StochasticPatchRunner<FF16>"=`StochasticPatchRunner<FF16>`)
  constructors[[check_type(type, valid)]]
}
